        return (x1 - x2) ** 2 + (y1 - y2) ** 2
    distances = [dist_sq(x1, y1, x2, y2), dist_sq(x1, y1, x3, y3), dist_sq(x1, y1, x4, y4), dist_sq(x2, y2, x3, y3), dist_sq(x2, y2, x4, y4), dist_sq(x3, y3, x4, y4)]
    distances.sort()
    return distances[0] > 0 and distances[0] == distances[1] == distances[2] == distances[3] and (distances[4] == distances[5]) and (distances[-4] == 2 * distances[0])

